import React from "react";

function ContactCustomer(){
    const contact = (message, event) => {
        alert(message);
        alert();
    }
    return(
        <button onClick={() => contact("CUSTOMER CONTACTED SUCCESSFULLY!!")}>CONTRACT CUSTOMER</button>
    );

}
export default ContactCustomer;
